script: |
  super -f text -I q3259.spq | sort > q3259.out

inputs:
  - name: q3259.spq
    data: |
      SELECT DISTINCT col0 / - col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE + col0 + 50 <> col1 + - ( col2 ) / col1;
  - name: tab1

outputs:
  - name: q3259.out
    data: |
      -1
      -17
      -3
